		case 4: c[2] = 2*pi3*pj*pk; c[3] = 6*pi4*pj*pk; break;
		case 5: c[3] = pi3*pj3; break;
		case 6: c[3] = 3*pi3*pj2*pk; break;
		case 7: c[3] = 6*pi3*pj*pk*pl; break;
		case 8: c[1] = pi3*pj; c[2] = 2*pi4*pj; c[3] = 3*pi5*pj; break;
		case 9: c[0] = 3*pi2*pj; c[1] = pi2*pj*(2*pi+pj); c[2] = pi3*pj*(pi+4*pj); c[3] = 9*pi4*pj2; break;
		case 10: c[1] = pi2*pj*pk; c[2] = 4*pi3*pj*pk; c[3] = 9*pi4*pj*pk; break;
		case 11: c[1] = 2*pi2*pj2; c[2] = 2*pi2*pj2*(pi+pj); c[3] = 9*pi3*pj3; break;
